import React from "react";
const SJTemplate = ({ data }) => {
  return (
    <div className="bg-image-s h-screen w-screen z-0 bg-center flex items-center">
      <div className="text-white flex flex-col px-2 max-w-sm bg-red-00 m-auto">
        <span className="font-black uppercase text-4xl tracking-wide text-center">
          {data.header}
        </span>
        <span className="text-lg my-8 text-center">{data.content}</span>
        <button className="bg-yellow-500 w-1/2 py-2 rounded-md m-auto">
          {data.btnText}
        </button>
      </div>
    </div>
  );
};

export default SJTemplate;
